function sort(list) 
{
    var qs = location.href;
    qs = qs.replace('&sort=', '&x=');
    qs = qs.replace('?sort=', '?x=');
    if (qs.indexOf('?') != -1) {
        qs += '&sort=' + list.options[list.selectedIndex].value;
    }
    else 
    {
        qs += '?sort=' + list.options[list.selectedIndex].value;
    }
    if (list.selectedIndex == 0) {
        qs = qs.replace('&sort=', '');
        qs = qs.replace('?sort=', '?');
    }
    location.href = qs;
}

